-- ----------------------------
-- View structure for cook_month_order
-- ----------------------------
DROP VIEW IF EXISTS `cook_month_order`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `cook_month_order` AS SELECT
	c.id,
	COUNT(*) as count
FROM
	cook c
LEFT JOIN v_order v ON v.cook_id = c.id
WHERE
	v.`status` = 2
AND date_format(`end_time`, '%Y%m') = date_format(curdate(), '%Y%m') 

GROUP BY c.id ;
